import './css/index.css'
import './css/test.less'
import './css/test2.scss'
import './assets/icon/iconfont.css'
import test from './test'
console.log(123123)
// var a = 123
setTimeout(() => {
  console.log(123123123)
}, 100);

function sum(...art) {
  console.log(art)
} 
sum(1,1,2,3)
test()

new Promise((reslove, reject) => {
  setTimeout(()=>{
    reslove(123123)
  },0)
})

